import React, { useState } from 'react';
import { Button, Card, Form, FormControl, Navbar } from 'react-bootstrap';
import fakedata from '../fakedata/fakedata'

import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css'


const Home = () => {

    const [data, setData] = useState(fakedata)
    console.log(data)

    return (
        <div>
            <h1 style={{ textAlign: 'center', marginTop: '50px' }}>I Grow by helping people if need</h1>

            <Navbar className="justify-content-center">
                <Form inline>
                    <FormControl type="text" placeholder="Search" className=" mr-xl-2" />
                    <Button type="submit">Submit</Button>

                </Form>
            </Navbar>

            <div >
                <div className="card-body">
                <img style={{width:'200px'}} src={data.img} className="card-img-top" alt="..." />

                    <h5 className="card-title">Card with stretched link</h5>
                    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    <a href="cdn" className="btn btn-primary stretched-link">Go somewhere</a>
                </div>
            </div>
        </div>
    );
};

export default Home;
